              context.fill();
              if (cfg.stars.designation && d.properties.mag <= cfg.stars.designationLimit*adapt) {
                setTextStyle(cfg.stars.designationStyle);
                context.fillText(starDesignation(d.id), pt[0]+r, pt[1]);
              }
